import logo from './logo.svg';
import './App.css';
import React, { useEffect, useState } from 'react';

const BASE_URL = "http://localhost:8000/"

function App() {
  const [posts, setPosts] = useState([])

  useEffect(() => {
    fetch(BASE_URL + 'post/all')
    .then(response => {
      const json = response.json()
      console.log(json);
      if (response.ok) {
        return json
      }
      throw response
    })
    .then(data => {
      return data.reverse()
    })
    .then(data => {
      setPosts(data)
    })
    .catch(error => {
      console.log(error);
      alert(error)
    })
  }, [])

  return (
